import React from 'react';
import './Logo.scss';

export default function Logo() {
    return (
        <div className='logo'>
            <div className='logo__name'>invoice</div>
            <div className='logo__title'>
                Online PDF Invoices Generator &amp; CMS
            </div>
        </div>
    );
}
